import React, { Component } from 'react';

class Santa extends Component {
  render() {
    return (
      <div>
        <h1>Welcome</h1>
            <img src="santa.png" id="santa"/>
            <p id="pc">To The Polish Campout</p>
            <p id="pc">Kris Kringle 2019</p>
      </div>
    );
  }
}

export default Santa;
